import React, { useEffect, useRef, useState } from 'react';
import './App.css';
import gsap from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';
import logo from './img/logo.png';
import hero1 from './img/hero_1.jpg';
import hero2 from './img/hero_2.jpg';
import hero3 from './img/hero_3.jpg';
import hero4 from './img/hero_4.jpg';
import hero5 from './img/hero_5.jpg';
import imgsq5 from './img/img_long_5.jpg';
import imgsq1 from './img/img_sq_1.jpg';
import img1 from './img/img_sq_1.jpg';
import img2 from './img/img_sq_3.jpg';
import img3 from './img/img_sq_4.jpg';
import img4 from './img/img_sq_5.jpg';
import img5 from './img/img_sq_6.jpg';
import img6 from './img/img_sq_8.jpg';
import testimonial1 from './img/testimonials/testimonials-1.jpg';
import testimonial2 from './img/testimonials/testimonials-2.jpg';
import testimonial3 from './img/testimonials/testimonials-3.jpg';
import testimonial4 from './img/testimonials/testimonials-4.jpg';
import blog1 from './img/blog/blog-1.jpg';
import blog2 from './img/blog/blog-2.jpg';
import blog3 from './img/blog/blog-3.jpg';
gsap.registerPlugin(ScrollTrigger);
export default function Home() {
        const [currentIndex, setCurrentIndex] = useState(0);
        const [currentIndex2, setCurrentIndex2] = useState(0);
          let test = document.querySelectorAll('.test');
        const imgRef = useRef(null);
        const conImg = useRef(null);
        const section1 = useRef();
        const section2 = useRef();
        const section3 = useRef();
        const section4 = useRef();
        const section5 = useRef();
        const section6 = useRef();
        const section7 = useRef();
        const section8 = useRef();
        function goSection1(){
          console.log("hello");
          window.scrollTo({top:section1.current.offsetWidth ,behavior:'smooth'});
        }
        function goSection2(){
          console.log("hello");
          window.scrollTo({top:section1.current.offsetWidth ,behavior:'smooth'});
        }
        function goSection3(){
            window.scrollTo({top:section1.current.offsetWidth,behavior:'smooth'})
        }
        function goSection4(){
          console.log("hello");
          window.scrollTo({top:section1.current.offsetWidth ,behavior:'smooth'});
        }
        function goSection5(){
            console.log("hello");
            window.scrollTo({top:section1.current.offsetWidth ,behavior:'smooth'});
          }
          function goSection6(){
            console.log("hello");
            window.scrollTo({top:section1.current.offsetWidth ,behavior:'smooth'});
          }
          function goSection7(){
            console.log("hello");
            window.scrollTo({top:section1.current.offsetWidth ,behavior:'smooth'});
          }
        const images = [hero1, hero2, hero3, hero4, hero5];
        const images2 = [img4, img2, img3, img1, img5, img6];
        function scrollTo(){
         window.scrollTo(0,0);
        }

        useEffect(() => {
          let tl = gsap.timeline();
          tl.fromTo(".logo", {
            y: -80,
            opacity: 0,
          },
            {
              y: 0,
              duration: 1,
              opacity: 1
            })
            tl.fromTo(".risp1", {
              y: -80,
              opacity: 0,
            },
              {
                y: 0,
                duration: 1,
                delay:-0.5,
                opacity: 1
              })
          tl.fromTo("li", {
            y: -40,
            opacity: 0
          },
            {
              y: 0,
              duration: 1,
              opacity: 1,
              delay: -0.5,
              stagger: 0.1
            }
          )
        }, [])

        useEffect(() => {
          gsap.fromTo(".textM", {
            y: -50,
            opacity: 0
          },
            {
              y: 0,
              opacity: 1,
              duration: 0.9,
              delay: 0.5
            }
          )

          gsap.fromTo(".textMM", {
            y: -50,
            opacity: 0
          },
            {
              y: 0,
              opacity: 1,
              duration: 1,
              delay: 0.5
            }
          )
          gsap.fromTo("#partImg", {
            scale: 1.2,
            opacity: 0
          },
            {
              scrollTrigger: {
                trigger: '.container1',
                scroller: 'body',
                markers: false,
                start: "top 80%",
                end: "top 60%"
              },
              opacity: 1,
              scale: 1,
              duration: 0.5,
              delay: 0.5
            }
          )
          gsap.fromTo(".part2", {
            y: 100,
            opacity: 0
          },
            {
              scrollTrigger: {
                trigger: '.container1 ',
                scroller: 'body',
                markers: false,
                start: "top 80%",
                end: "top 60%"
              },
              y: 0,
              opacity: 1,
              duration: 0.5,
              delay: 0.5
            }
          )
          gsap.fromTo(".section1", {
            y: 100,
            opacity: 0
          },
            {
              y: 0,
              opacity: 1.4,
              duration: 0.8,
              delay: 0.4
            })
          gsap.fromTo(".section2", {
            scale: 1.2,
            opacity: 0
          },
            {
              scale: 1,
              opacity: 1,
              duration: 1
            })
        })

        let imgLen = images.length;
        let imgLen2 = images2.length;
        const slideLeft = () => {
          let newIndex1 = currentIndex === 0 ? imgLen - 1 : currentIndex - 1;
          setCurrentIndex(newIndex1);
          let valueP = -newIndex1 * window.innerWidth;
          gsap.to(imgRef.current, {
            x: valueP,
            duration: 1,
            delay: 0.1
          });
        }
        const slideRight = () => {
          let newIndex2 = currentIndex === imgLen - 1 ? 0 : currentIndex + 1;
          setCurrentIndex(newIndex2);

          let valuePP = -newIndex2 * window.innerWidth;
          gsap.to(imgRef.current, {
            x: valuePP,
            duration: 1,
            delay: 0.1,
          });
        }
      //for left arrow
      const [k1, setK1] = useState(180);
      const slideLeft2 = () => {
         setK1(prevK => prevK - 60);
         let newInd2 =  currentIndex2 === 0? imgLen2-3 : currentIndex2-1;
         let valueP2 = -newInd2 * conImg.current.offsetWidth/imgLen2-1;
         let valueP3 = valueP2-k1;
         setCurrentIndex2(newInd2);
         gsap.to(conImg.current,{
           x : valueP3,
           duration:1,
           delay:0.5,
         }
         )  }
      // }

      //for right arrow
          const [k, setK] = useState(60);

          const slideRight2 = () => {
            setK(prevK => prevK + 60);
          let newInd2 =  currentIndex2 === imgLen2-3 ? 0 : currentIndex2+1;
          setCurrentIndex2(newInd2);

          test.forEach((element,index)=>{
            if(index === currentIndex2){
              element.style.backgroundColor = "#116530";
            }else if(index < currentIndex2){
              element.style.backgroundColor = "#2f2f2f";
            }else if(index > currentIndex2){
              element.style.backgroundColor = "#2f2f2f";
            }
           })

          if(!newInd2){
            setK(60);
            gsap.to(conImg.current,{
              x : 7,
              duration:1,
              delay:0.5,
             }) 
          }
          else{
            let valueP2 = -newInd2 * conImg.current.offsetWidth/imgLen2-1;
            console.log(valueP2)
            let valueP3 = valueP2-k;
            gsap.to(conImg.current,{
              x : valueP3,
              duration:1,
              delay:0.5,
            })  }
         }


        let text0 = {
          position: 'absolute',
          transform: `translateX(${0 * window.innerWidth}px)`,
          top: '30%',
          left: '30%', color: 'white',
          zIndex: '25',
        };
        let text1 = {
          position: 'absolute',
          transform: `translateX(${1 * window.innerWidth}px)`,
          top: '30%',
          left: '30%',
          color: 'white',
          zIndex: '25'
        };

        let text2 = {
          position: 'absolute',
          transform: `translateX(${2 * window.innerWidth}px)`,
          top: '30%',
          left: '30%', color: 'white',
          zIndex: '25',
        };
        let text3 = {
          position: 'absolute',
          transform: `translateX(${3 * window.innerWidth}px)`,
          top: '30%', color: 'white',
          left: '35%',
          zIndex: '25',
        };
        let text4 = {
          position: 'absolute',
          transform: `translateX(${4 * window.innerWidth}px)`,
          top: '30%',
          left: '35%', color: 'white',
          zIndex: '25',
        };
        let paragraph1 = {
          position: 'absolute',
          transform: `translateX(${0 * window.innerWidth}px)`,
          top: '45%',
          left: '30%',
          color: 'white',
          zIndex: '25',
        };

        let paragraph2 = {
          color: 'white',
          position: 'absolute',
          transform: `translateX(${1 * window.innerWidth}px)`,
          top: '45%',
          left: '30%',
          zIndex: '25',
        };
        let paragraph3 = {
          position: 'absolute',
          transform: `translateX(${2 * window.innerWidth}px)`,
          top: '45%',
          left: '30%', color: 'white',
          zIndex: '25',
        };
        let paragraph4 = {
          position: 'absolute',
          transform: `translateX(${3 * window.innerWidth}px)`,
          top: '40%',
          left: '30%',
          zIndex: '25', color: 'white',
        };
        let paragraph5 = {
          position: 'absolute',
          transform: `translateX(${4 * window.innerWidth}px)`,
          top: '40%',
          left: '30%', color: 'white',
